import React from 'react';
import {ButtonStyle,InputStyle} from './style'

export default function Search(){
    return(
        <>
                <div className="col-12">
                            <form action="">
                                <InputStyle type="text" placeholder="Search..." name="search"/>
                                <ButtonStyle type="submit" ><img src={require("../../../images/Search.svg")} alt="search"/></ButtonStyle>
                              </form>
                </div>
        </>
    )
}
